package com.example.pushtounv;

import androidx.appcompat.app.AppCompatActivity;

import android.os.Bundle;
import android.view.View;
import android.widget.Button;
import android.widget.EditText;
import android.widget.Toast;

import com.example.pushtounv.models.Customer;
import com.example.pushtounv.models.ResponseRegisterCustomer;

import java.util.ArrayList;
import java.util.List;
import java.util.concurrent.TimeUnit;

import okhttp3.OkHttpClient;
import retrofit2.Call;
import retrofit2.Callback;
import retrofit2.Response;
import retrofit2.Retrofit;
import retrofit2.converter.gson.GsonConverterFactory;

public class MainActivity extends AppCompatActivity {

    private String demoBase64 = "";
    private EditText edt;
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        edt = findViewById(R.id.edt);
        Button btnRegister = findViewById(R.id.btn_register);

        btnRegister.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                OkHttpClient okHttpClient = new OkHttpClient.Builder()
                        .readTimeout(120, TimeUnit.SECONDS)
                        .build();
                Retrofit retrofit = new Retrofit.Builder()
                        .baseUrl(edt.getText().toString())
                        .addConverterFactory(GsonConverterFactory.create())
                        .client(okHttpClient)
                        .build();

                Customer customer = new Customer();
                customer.setFullName("Nguyễn Đức Anh");
                customer.setIdNumber("030200004945");
                customer.setImage(demoBase64);
                RetrofitService retrofitService = retrofit.create(RetrofitService.class);
                retrofitService.registerCustomer(customer).enqueue(new Callback<ResponseRegisterCustomer>() {
                    @Override
                    public void onResponse(Call<ResponseRegisterCustomer> call, Response<ResponseRegisterCustomer> response) {
                        if (response.body() != null) {
                            if (response.body().getIsSuccess()) {
                                Toast.makeText(MainActivity.this, "Đăng ký khách thành công lên thiết bị", Toast.LENGTH_SHORT).show();
                            }else{
                                Toast.makeText(MainActivity.this, "Đăng ký khách thất bại", Toast.LENGTH_SHORT).show();
                            }
                        }else{
                            Toast.makeText(MainActivity.this, "Đăng ký khách thất bại", Toast.LENGTH_SHORT).show();
                        }
                    }

                    @Override
                    public void onFailure(Call<ResponseRegisterCustomer> call, Throwable t) {
                        Toast.makeText(MainActivity.this, t.getMessage(), Toast.LENGTH_SHORT).show();
                    }
                });
            }
        });
    }
}